import { StyleSheet } from 'react-native';

const ResultStyle = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
    backgroundColor: '#FFFFFF',
    borderRadius: 30,
  },
  topinfo: {
    backgroundColor: '#48cff4',
    borderRadius: 30,
    width: 414,
    height: 525,
    justifyContent: 'center',
    alignItems: 'center',
  },
  row: {
    width: 414,
    height: 57,
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'center',
    padding: 10,
    gap: 44,
  },
  backmenu: {
    width: 53,
    height: 53,
  },
  rectangle: {
    width: 53,
    height: 53,
    backgroundColor: '#71ddff',
    padding: 5,
    marginRight: 220,
    borderRadius: 100,
    justifyContent: 'center',
    alignItems: 'center',
  },
  backArrow: {
    fontSize: 22,
    color: 'rgba(255, 255, 255, 0.4)',
  },
  mainphoto: {
    width: 360,
    height: 360,
  },
  content: {
    width: 360,
    height: 360,
  },
  elipse2: {
    justifyContent: 'center',
    alignItems: 'center',
    width: 360,
    height: 360,
    borderRadius: 180,
    borderWidth: 3,
    borderColor: 'rgba(255, 255, 255, 0.2)',
  },
  elipse: {
    justifyContent: 'center',
    alignItems: 'center',
    width: 309,
    height: 309,
    borderRadius: 154.5,
    backgroundColor: '#FFFFFF',
  },
  camera: {
    width: 275,
    height: 275,
    borderRadius: 137.5,
  },
  bottominfo: {
    backgroundColor: '#FFFFFF',
    width: 414,
    height: 371,
    borderRadius: 30,
    justifyContent: 'center',
    alignItems: 'center',
  },
  circleChart: {
    position: 'relative',
    width: 250,
    height: 250,
    margin: 0,
    justifyContent: 'center',
    alignItems: 'center',
  },
  circleChartPercentage: {
    width: 200,
    height: 200,
    borderRadius: 100,
    position: 'absolute',
    top: '50%',
    left: '50%',
    transform: [{ translateX: -100 }, { translateY: -100 }],
    justifyContent: 'center',
    alignItems: 'center',
    backgroundColor: '#48cff4',
  },
  circleChartBackground: {
    position: 'absolute',
    top: 0,
    left: 0,
    width: '100%',
    height: '100%',
  },
  resultText: {
    fontStyle: 'normal',
    fontWeight: '700',
    fontSize: 27,
    lineHeight: 67,
    display: 'flex',
    alignItems: 'flex-end',
    color: '#000000',
  },
  scanningText: {
    fontStyle: 'normal',
    fontWeight: '700',
    fontSize: 27,
    lineHeight: 67,
    display: 'flex',
    alignItems: 'flex-end',
    color: '#000000',
  },
});

export default ResultStyle;
